ISLAMABAD, Feb 9 (APP): Pakistan Muslim League Nawaz Muhammad Asif Malik won the Punjab Assembly elections from PP-82 (Khushab-II) by securing 41,575 votes.
According to the unofficial results issued by the returning officer/ECP, his runner-up was an Independent candidate 39,529 votes. Votersâ€™ turn-out remained at 49.45 per cent.
